import React from 'react';
import Button from './Button';
import './App.css';
import mySound from './babuins.mp3'
import useSound from 'use-sound'

function App() {
  function BtnActn(){
    const [playSound] = useSound(mySound);
    console.log('Playing a sound!');
    return (
      playSound()
    );
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Simple DJ App</h1>
        <Button text="Play Sound" onClick={BtnActn()} />
      </header>
    </div>
  );
}

export default App;
